import React from 'react';

const style = {
    main: {
       display: 'flex',
       height: '100%',
       width:'100%',
       background:'#ff773b'
    },
    divInfo:{
       display:'flex',
       height:'100%',
       width:'60%'
    },
    divLogin:{
       height:'100%',
       width:'40%'
    }
}

const Login = () => {
    return (
        <main style={style.main}>
            <div style={style.divInfo}>
                <section>

                </section>
            </div>
            <div style={style.divLogin}>
                <section>

                </section>
            </div>
        </main>
    )
}

export default Login
